--
-- Table structure for table `member`
--

CREATE TABLE `member` (
  `id` varchar(191) NOT NULL,
  `organizationId` varchar(191) NOT NULL,
  `memberCode` varchar(191) NOT NULL,
  `name` varchar(191) NOT NULL,
  `dob` datetime(3) DEFAULT NULL,
  `contact` varchar(191) DEFAULT NULL,
  `email` varchar(191) DEFAULT NULL,
  `address` varchar(191) DEFAULT NULL,
  `idNumber` varchar(191) DEFAULT NULL,
  `passportPhotoUrl` varchar(191) DEFAULT NULL,
  `isDependent` tinyint(1) NOT NULL DEFAULT 0,
  `familyRelationship` varchar(191) DEFAULT NULL,
  `gender` varchar(191) DEFAULT NULL,
  `country` varchar(191) DEFAULT NULL,
  `companyId` varchar(191) DEFAULT NULL,
  `status` varchar(191) NOT NULL DEFAULT 'Active',
  `createdAt` datetime(3) NOT NULL DEFAULT current_timestamp(3),
  `updatedAt` datetime(3) NOT NULL,
  `deletedAt` datetime(3) DEFAULT NULL,
  `categoryID` varchar(191) NOT NULL,
  `endOfSubscription` datetime(3) NOT NULL DEFAULT (current_timestamp() + interval 6 month)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

